import React, { useRef} from "react";
import { FaBars } from "react-icons/fa";
import { useNavigate } from "react-router-dom";

function NavBar() {
  const nav = useRef();
  const showNavbar = () => {
    console.log("Show navbar called");
    nav.current.classList.toggle("responsive_nav");
  };


  const navigate = useNavigate();
  function handleClick(){
    if(true){
      navigate("/");
    }
  
  }
  
  // useEffect(()=>{
  //   setClickLogin(true);
  //   navigate("/login");
  //  })

  return (
    <div>
      <div className="container" id="container">
        <div className="wrap">
          <img className="doglogo push" src="/doglogo.png" alt="logo"></img>
          <button onClick={handleClick}className="login">Login</button>
          <button className="signup">Sign Up</button>
          <button className="hamburger_menu" onClick={showNavbar}>
            <FaBars />
          </button>
        </div>
      </div>
    </div>
  );
}

export default NavBar;
